import IcerıkDetay from "components/page-component/Main/DetayPage/IcerıkDetay";
import Footer from "layout/web/Footer/Footer";
import Header from "layout/web/Header/Header";
import NavbarMenu from "layout/web/navbar/Navbar";

const Home = ({ data }) => {
    return (
        <div className="home_page">
            <Header data={data} />
            <NavbarMenu />
            <MainComponent/>
            <Footer />
        </div>
    )
};

export default Home;
